parameters.jsCode:
function formatPhoneNumber(phoneNumber) {
    // Remove all non-digit characters
    let cleaned = phoneNumber.replace(/\D/g, '');

    // Ensure the number has 11 digits (including the country code)
    if (cleaned.length === 11 && cleaned.startsWith('1')) {
        // Remove the leading country code
        cleaned = cleaned.slice(1);
    }

    // Return empty array if not exactly 10 digits after processing
    if (cleaned.length !== 10) {
        return [];
    }

    // Return array with object containing the cleaned phone number
    return [{
        "Cleaned Phone": cleaned
    }];
}

// Get just the formatted number from the result:
const result = formatPhoneNumber($('Webhook').all()[0].json.body.booking.custom_fields.custom_phone);
if (result.length > 0) {
    return [{"Cleaned Number": result[0]["Cleaned Phone"]}];
}

